											reader.onload = function (evt) {

											templatesurf.then(function() {

										complex.setStyle({stick:{'colorscheme':{'prop':'resi', 'gradient':'roygb','min':-2,'max':5}}})
										glviewer.zoomTo();
										glviewer.render();
										return complex
